import React, { Component } from 'react';
import Input from './Input';

class Experience extends Component {
    render() {
        return(
            <fieldset>
                <legend>Experience</legend>
                <Input name="Position" />
                <Input name="Company" />
                <Input name="City" />
                <Input name="From" />
                <Input name="To" />
            </fieldset>
        )
    }
}

export default Experience;
